
def originalLengthOfLongestSubstring(s: str) -> int:
    d = [1] * len(s)
    m = {}
    start = end = 0
    for i, c in enumerate(s):
        end += 1
        if c in m:
            start = m[c] + 1
            if i - 1 == m[c]:
                m.clear()
            else:
                for j in range(start - 1, -1, -1):
                    if s[j] in m:
                        if m[s[j]] < start:
                            del m[s[j]]
            m[c] = i
            d[i] = end - start
            continue
        m[c] = i
        d[m[c]] = end - start
    return max(d)

def lengthOfLongestSubstring(s: str) -> int:
    start = 0
    hTable = {}
    biggest = 0
    for i in range(len(s)):
        char = s[i]
        if char in hTable and hTable[char] >= start:
            start = hTable[char] + 1
        else:
            biggest = max(biggest, i - start + 1)
        hTable[char] = i
    return biggest

